BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "woodcutter_gamelog" ("log" varchar(10000) NOT NULL, "supply" varchar(500) NOT NULL, "game_id" integer NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "woodcutter_preddata" ("regex" varchar(150) NOT NULL, "source" integer NOT NULL, "destination" integer NOT NULL, "id" integer NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "woodcutter_carddata_exceptions" ("id" serial NOT NULL PRIMARY KEY, "carddata_id" integer NOT NULL REFERENCES "woodcutter_carddata" ("id") DEFERRABLE INITIALLY DEFERRED, "exceptiondata_id" integer NOT NULL REFERENCES "woodcutter_exceptiondata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "woodcutter_carddata" ("id" integer NOT NULL PRIMARY KEY, "single_name" varchar(30) NOT NULL, "multi_name" varchar(30) NOT NULL, "cost" integer NOT NULL, "color" varchar(8) NOT NULL, "border_color" varchar(8) NOT NULL, "phrase_name" varchar(30) NOT NULL);
CREATE TABLE IF NOT EXISTS "woodcutter_exceptiondata_root_preds" ("id" serial NOT NULL PRIMARY KEY, "exceptiondata_id" integer NOT NULL REFERENCES "woodcutter_exceptiondata" ("id") DEFERRABLE INITIALLY DEFERRED, "preddata_id" integer NOT NULL REFERENCES "woodcutter_preddata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "woodcutter_exceptiondata_target_cards" ("id" serial NOT NULL PRIMARY KEY, "exceptiondata_id" integer NOT NULL REFERENCES "woodcutter_exceptiondata" ("id") DEFERRABLE INITIALLY DEFERRED, "carddata_id" integer NOT NULL REFERENCES "woodcutter_carddata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "woodcutter_exceptiondata_target_preds" ("id" serial NOT NULL PRIMARY KEY, "exceptiondata_id" integer NOT NULL REFERENCES "woodcutter_exceptiondata" ("id") DEFERRABLE INITIALLY DEFERRED, "preddata_id" integer NOT NULL REFERENCES "woodcutter_preddata" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "woodcutter_exceptiondata" ("id" serial NOT NULL PRIMARY KEY, "source" integer NOT NULL, "destination" integer NOT NULL, "root_card_id" integer NOT NULL REFERENCES "woodcutter_carddata" ("id") DEFERRABLE INITIALLY DEFERRED);
COMMIT;
